                <div className="row h-100">
                    <div className="col-md-6 bg-dark">

                    </div>
                    <div className="col-md-6 d-flex flex-column justify-content-center align-items-center px-5">
                        <h1 className="w-100 text-center">Sign in to Clever</h1>
                        <div className="d-flex justify-content-center my-3">
                            <a href="" className="rounded rounded-5 bg-light p-4 m-2"></a>
                            <a href="" className="rounded rounded-5 bg-light p-4 m-2"></a>
                            <a href="" className="rounded rounded-5 bg-light p-4 m-2"></a>
                        </div>
                        <div className="w-100 d-flex justify-content-center align-items-center bg-dark my-2" style={{height:"2px"}}>
                            <small className="bg-white m-0 px-3 py-2">or do it via E-mail</small>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Connexion;
